//測試個人

import React,{Component,useEffect} from "react";
import { Line } from "react-chartjs-2";
import {Div0,DataDrawItem,Div1} from'./sty';
// import {Dataq} from './data.js'
import {data1234} from './data.js'
const token ='eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiJ9.eyJ1c2VyX2lkIjoiYWRtaW4iLCJfaWQiOiI2MzRhNDg5OTJkNzAyY2EzYWRlNTlmMzYiLCJlbWFpbCI6InpzZGE1ODU4c2RhQGdtYWlsLmNvbSIsInJvbGUiOjkwMCwiZXhwIjoxNjY1OTA1MjcxfQ.e3xoaWLyhowVnA5MQ3ToFSP36H9XmyJSO04x-G6NsLU';
var data;
if (!data){
    // data=Dataq();
}
const data123 = [
    {name: 'Page A', biceps: 100, squat: 2400},
    {name: 'Page B', biceps: 1398, squat: 2210},
    {name: 'Page C', biceps: 9800, squat: 2290},
    {name: 'Page D', biceps: 3908, squat: 2000},
    {name: 'Page E', biceps: 4800, squat: 2181},
    {name: 'Page F', biceps: 3800, squat: 2500},
    {name: 'Page G', biceps: 4300, squat: 2100},
];

class DataDrawList extends Component{
    
    constructor(props){
        super(props);
        this.state={
        "data":[]
    };
    }
    componentDidMount(){
    this.getItems();
    }
    getItems(){
    fetch('https://backend-111406.onrender.com/api/record/user4', {
                method: "GET",
                headers: new Headers({
                    'Content-Type': 'application/json',
                    'token': `eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiJ9.eyJ1c2VyX2lkIjoiYWRtaW4iLCJfaWQiOiI2MzRhNDg5OTJkNzAyY2EzYWRlNTlmMzYiLCJlbWFpbCI6InpzZGE1ODU4c2RhQGdtYWlsLmNvbSIsInJvbGUiOjkwMCwiZXhwIjoxNjY1OTA5NTY0fQ.8IutWMIW08eDjDXHi0R-_dCpTm5vcjIr8zH5M1VkLhE`, /* 把token放在這 */
                })
}
    )
    
    .then(results=>results.json())
    .then(results=>{this.setState({"datatimes":results.data})
                   });
    }
    
    
    render(){
        return (
                <Div0>
                    <DataDrawItem>
                    <LineChart width={400} height={250} data={data}
                    margin={{top: 5, right: 30, left: 20, bottom: 5}}>
                <XAxis dataKey="name"/>
                <YAxis/>
                <CartesianGrid strokeDasharray="3 3"/>
                <Tooltip/>
                <Legend />
                <Line type="monotone" dataKey="biceps" stroke="#8884d8" activeDot={{r: 8}}/>
                <Line type="monotone" dataKey="deltoid" stroke="#82ca9d" />
                <Line type="monotone" dataKey="squat" stroke="#7C9C99" />
            </LineChart>
                    </DataDrawItem>
                    <DataDrawItem>
                    <LineChart width={400} height={250} data={data}
                    margin={{top: 5, right: 30, left: 20, bottom: 5}}>
                <XAxis dataKey="name"/>
                <YAxis/>
                <CartesianGrid strokeDasharray="3 3"/>
                <Tooltip/>
                <Legend />
                <Line type="monotone" dataKey="biceps" stroke="#8884d8" activeDot={{r: 8}}/>
                <Line type="monotone" dataKey="deltoid" stroke="#82ca9d" />
                <Line type="monotone" dataKey="squat" stroke="#7C9C99" />
            </LineChart>
                    </DataDrawItem>
                    <DataDrawItem></DataDrawItem>
                </Div0>
        )}}
export default DataDrawList;
